package comp533.partitioner;

import util.trace.Tracer;

public class TokenCounterPartitioner extends Partitioner<String, Integer> {
    @Override
    public int getPartition(String key, Integer value, int numOfPartitions) {
        char keyFirstChar = key.charAt(0);
        if (!Character.isLetter(keyFirstChar)) {
            return 0;
        }
        char lowercaseKeyFirstChar = Character.toLowerCase(keyFirstChar);
        int maxPartitionSize = (int) Math.ceil((('z' - 'a' + 1) * 1.0) / (numOfPartitions * 1.0));
        return (int) Math.floor(((lowercaseKeyFirstChar - 'a' + 1) * 1.0) / (maxPartitionSize * 1.0));
    }
}

package comp533.reducer;

import comp533.keyvalue.KeyValue;
import gradingTools.comp533s19.assignment0.AMapReduceTracer;

import java.util.HashMap;
import java.util.List;
import java.util.Map;


public class TokenCounterReducer extends AMapReduceTracer implements Reducer<String, Integer>{
    public Map<String, Integer> reduce(List<KeyValue<String, Integer>> argList) {
        Map<String, Integer> map = new HashMap<>();
        for (KeyValue<String, Integer> keyValue: argList) {
            String key = keyValue.getKey();
            int value = keyValue.getValue();
            if (map.containsKey(key)) {
                int sum = map.get(key);
                sum += value;
                map.put(key, sum);
            } else {
                map.put(key, value);
            }
        }
        this.traceReduce(argList, map);
        return map;
    }
}

package comp533.mvc;

import comp533.barrier.Barrier;
